import React from "react";
import { Link } from "react-router-dom";

const MainNavigation = () => {
  return (
    <header>
      <nav id="navbar">
        <li>
          <p>
            <Link to="/">Home</Link>
          </p>
          <p>
            <Link to="/dashboard">Dashboard</Link>
          </p>
          <p>
            <Link to="/contact">Contact</Link>
          </p>
        </li>
      </nav>
    </header>
  );
};

export default MainNavigation;
